import { Component, OnInit, ViewChild } from '@angular/core';
import { IonList, IonicModule, ItemSlidingCustomEvent, LoadingController, RefresherCustomEvent } from '@ionic/angular';

import { CommonModule } from '@angular/common';
import { MenuService } from '../services/menu/menu.service';
import { Title } from '@angular/platform-browser';

import { ContactPayload, Contacts, EmailType, GetContactResult, GetContactsResult, PhoneType, PostalAddressType, Projection } from '@capacitor-community/contacts';
import { ContactService } from '../services/contact/contact.service';
import { Router, RouterLink } from '@angular/router';
import { FirestoreDocumentMapping } from '../services/firebase/firebase.models';
import { IAppContact, IAppUIContact } from '../services/contact/contact.models';
import { SelectedContactService } from '../contact/contact.service';


@Component({
  selector: 'app-contacts',
  templateUrl: 'contacts.page.html',
  styleUrls: ['contacts.page.scss'],
  standalone: true,
  providers: [MenuService],
  imports: [IonicModule, CommonModule, RouterLink],
})
export class ContactsPage implements OnInit {
  contacts: IAppContact[] = [];
  @ViewChild('list') list: IonList | undefined;
  dbContacts: FirestoreDocumentMapping<IAppContact>[] = [];
  displayContacts: IAppUIContact[] = [];
  constructor(
    private service: ContactService,
    titleService: Title,
    private loadingCtrl: LoadingController,
    private router: Router,
    private selectedContactService: SelectedContactService,
  ) {
    titleService.setTitle('Contacts');
  }

  async ngOnInit(): Promise<void> {
    await this.load();
  }

  async refresh($event: any): Promise<void> {
    await this.load();
    await $event.target.complete();
  }

  private async load(getContacts = true) {
    if (getContacts) {
      this.contacts = await this.retrieveListOfContacts();
    }
    this.dbContacts = await this.service.getContacts();
    this.displayContacts = this.contacts.map((contact) => {
      const dbContact = this.dbContacts.find((dbContact) => dbContact?.data.contactId === contact.contactId);
      return {
        contact,
        dbContact
      } as IAppUIContact;
    });
  }

  private async retrieveListOfContacts() {
    const projection: Projection = {
      // Specify which fields should be retrieved.
      name: true,
      phones: true,
      emails: true,
      birthday: true,
      image: true,
      postalAddresses: true,
    };

    let contactResult: GetContactsResult;
    try {
      contactResult = await Contacts.getContacts({
        projection,
      });
    } catch (error) {
      contactResult = { contacts: [] };
    }
    if (!contactResult?.contacts?.length) {
      contactResult = fakeContactResult;
    }

    return contactResult.contacts?.map((contact) => contact as unknown as IAppContact) ?? [];
  }

  async addContact(contact: IAppContact, $event: Event) {
    await this.service.addContact(contact);
    await this.load(false);
    await this.list?.closeSlidingItems();
  }

  async deleteContact(contact: FirestoreDocumentMapping<IAppContact>, $event: Event) {
    await this.service.deleteContact(contact.id);
    await this.load(false);
    await this.list?.closeSlidingItems();
  }

  async selectContact(contact: IAppUIContact) {
    this.selectedContactService.selectedContact = contact;
    await this.router.navigate(['/contacts', contact.contact.contactId]);
  }
}


